('message_type', 'message_type', 0, 9, 9, 'und', 0, 'Order [message:message-commerce-order:order-number] at [site:name]', NULL),
('message_type', 'message_type', 0, 9, 9, 'und', 1, '<div class="message-wrapper">\r\n  <div class="header">\r\n    <div class="logo"><a href="[site:url]">[site:site-logo]</a></div>\r\n    <div class="thank-you">Thanks for your order</div>\r\n  </div>\r\n\r\n  <div class="body">\r\n    <p class="detail">\r\n      Here are the details for your order <span class="order"><a href="[message:message-commerce-order:view-url]">#[message:message-commerce-order:order-id]</a></span>, placed on [message:message-commerce-order:created]\r\n    </p>\r\n\r\n    <div class="view-order-status [message:message-commerce-order:status]"><a href="[message:message-commerce-order:view-url]">View your order</a></div>\r\n\r\n    <div class="shipping-wrapper">\r\n      <div class="ship-to">\r\n        <p class="ship-to-title">Ship to</p>\r\n        <p class="details">\r\n          [message:message-commerce-order:commerce-customer-shipping:commerce_customer_address]\r\n        </p>\r\n      </div>\r\n\r\n      <div class="ship-method">\r\n        <p class="ship-method-title"></p>\r\n        <p class="express-delivery"></p>\r\n        <p class="details"></p>\r\n      </div>\r\n    </div>\r\n\r\n\r\n    <div class="order-summary-wrapper">\r\n    <p class="items-title">Items in your order</p>\r\n     !order-summary\r\n    </div>\r\n\r\n    <p class="question"><b>Order questions ?</b> <a href="[site:url]/contact">Contact us</a></p>\r\n\r\n  </div>\r\n</div>\r\n', 'full_html'),
('message_type', 'message_type', 0, 10, 10, 'und', 0, 'Order @{message:message-commerce-order:order-number} at [site:name]', NULL),
('message_type', 'message_type', 0, 10, 10, 'und', 1, 'A new order (@{message:message-commerce-order:order-number}) has been placed at [site:name].\r\nHere is a link to the order:\r\n\r\n[message:message-commerce-order:view-url]', 'commerce_order_message');
